import React, {Component} from 'react';

class MonsterEyes extends Component{

    constructor(props){
        super(props)
        this.state = { left:0, top:0, random:Math.random()*this.props.width}
    }

    render(){
        return (
            <div className="monster" >
                <div className="monster_sprite"></div>
                <h3>{this.props.height} {this.props.width} {this.state.top} {this.state.left} {this.state.random}</h3>
            </div>
        )
    }

}

export default MonsterEyes
